    <div className='container-fluid'>
    

{
    user!==null?

    <Row ClassName=''>
    <Column column=''>
        <Navbar>
            
        <li className="nav-item">
            <NavLink  to={'/Login'}  className={`nav-link `} end>Login</NavLink >
